I have never been in a calendar before! But thanks to Tyler Warren Ellis’ unique photography skills and the lovely people in St. Andrews by-the-Sea, this glorious photo from my show at the Kingsbrae amphitheatre in August this year appears in the new 2023 calendar! 

So excited to appear on the official calendar for Canada’s most beautiful town! Congratulations Tyler and thank you for capturing this special moment. Performing to 1200+ people in a town with little more than that is a uniquely special feeling and testament to the oft-forgotten yet obvious tourism attraction of the performing arts but especially stand up comedy. Thanks to everyone who came especially those who travelled from across Canada, the States and even Europe for the show! Happy I get to share our moment together in this calendar.

